import React, { Component } from 'react';
import MessageList from './components/MessageList';
import MessageBox from './components/MessageBox';
import Header from './components/Header'
import firebase from 'firebase';


class App extends Component {
  constructor(props){
    super(props);
    var config = {
      apiKey: "AIzaSyArUXnk5VfvgW_i1GC6qyy1_a16Oq4mILo",
      authDomain: "jewelryhandshop-beirut.firebaseapp.com",
      databaseURL: "https://jewelryhandshop-beirut.firebaseio.com",
      projectId: "jewelryhandshop-beirut",
      storageBucket: "jewelryhandshop-beirut.appspot.com",
      messagingSenderId: "676969995100"
    };
    firebase.initializeApp(config);
  }
  render() {
    return (
      <div className="container">
      <Header title="Simple Firebase App" />
      <div className="columns">
        <div className="column is-3"></div>
        <div className="column is-6">
          <MessageList db={firebase} />
        </div>
      </div>
      <div className="columns">
        <div className="column is-3"></div>
        <div className="column is-6">
          <MessageBox db={firebase} />
        </div>
      </div>
  </div>
    );
  }
}

export default App;
